using HTTP, HTTP.Parsers


function parse_multipart(data::Vector{UInt8})
    local chunk_end = find_end_of_chunk_size(data)
    local boundary = data[1:chunk_end - 2] # without \r\n
    local header_end = find_end_of_header(data)

    local data_start = header_end + 1
    local data_end = length(data) - chunk_end - 2
    if (data[data_end + 1: end] == [boundary..., 0x2d, 0x2d, 0x0d, 0x0a])
       local result = data[data_start : data_end]
       length(result) > 10 && return result # fails on empty new lines
    end
    return nothing
end

